PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE users (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT,
    role TEXT
  );
CREATE TABLE leads (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT,
    phone TEXT,
    source TEXT,
    status TEXT,
    notes TEXT,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP
  , showroom TEXT DEFAULT 'Main Showroom', frequency INTEGER DEFAULT 1, next_call_date DATETIME, current_call_date DATETIME, assigned_to TEXT, stage TEXT);
CREATE TABLE inventory (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    item_type TEXT,
    item_name TEXT,
    sku TEXT UNIQUE,
    quantity INTEGER,
    unit_cost REAL,
    reorder_level INTEGER
  , showroom TEXT DEFAULT 'Main Showroom', po_no TEXT, purchase_date TEXT, warranty TEXT, warranty_duration TEXT, warranty_parts TEXT, unique_no TEXT, model TEXT, colour TEXT, chasis_no TEXT, motor_no TEXT, controller_no TEXT, volt TEXT, amp TEXT, breakdown_volt TEXT, size TEXT, watt TEXT, controller_type TEXT, status TEXT DEFAULT "available", customer_id INTEGER);
CREATE TABLE customers (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT,
    phone TEXT,
    vehicle_registration TEXT,
    purchase_date TEXT,
    uptime_pass_status TEXT,
    uptime_pass_expiry TEXT
  , showroom TEXT DEFAULT 'Main Showroom', aadhar_number TEXT, address TEXT, alt_phone TEXT, referral_code TEXT, password TEXT DEFAULT "1234");
CREATE TABLE sales (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    customer_name TEXT,
    vehicle_reg TEXT,
    selling_price REAL,
    payment_mode TEXT,
    uptime_pass BOOLEAN,
    sale_date DATETIME DEFAULT CURRENT_TIMESTAMP
  , showroom TEXT DEFAULT 'Main Showroom', mode_of_sale TEXT, cash_upi_amount REAL, cash_cash_amount REAL, cash_collected_by TEXT, finance_down_payment REAL, finance_dp_cash REAL, finance_dp_cash_by TEXT, finance_dp_upi REAL, finance_loan_number TEXT, finance_emi REAL, finance_tenure INTEGER, finance_schedule TEXT, finance_start_date TEXT, finance_bank TEXT, battery_type TEXT, battery_id TEXT, battery_driver_id TEXT, sale_no TEXT, battery_sku TEXT, vehicle_sku TEXT, vehicle_model TEXT, salesperson TEXT, referral TEXT, aadhar_number TEXT, address TEXT, alt_phone TEXT, business_type TEXT DEFAULT "sale");
CREATE TABLE service_records (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    customer_id INTEGER,
    customer_name TEXT,
    vehicle_registration TEXT,
    service_type TEXT,
    issue_description TEXT,
    parts_charge REAL,
    labor_charge REAL,
    total_charge REAL,
    service_date DATETIME DEFAULT CURRENT_TIMESTAMP,
    status TEXT,
    response_time_mins INTEGER,
    parts_used TEXT -- JSON string
  , showroom TEXT DEFAULT 'Main Showroom', ticket_no TEXT, phone TEXT, raised_by TEXT, rsa_required INTEGER DEFAULT 0, rsa_location TEXT, assigned_serviceman_id INTEGER, assigned_serviceman_name TEXT, diagnosis_start_time DATETIME, exact_issue TEXT, estimated_tat TEXT, estimated_cost REAL, customer_consent INTEGER, checklist_solved INTEGER DEFAULT 0, checklist_test_drive INTEGER DEFAULT 0, checklist_no_parts_left INTEGER DEFAULT 0, checklist_replaced_returned INTEGER DEFAULT 0, customer_feedback TEXT, payment_mode TEXT, closing_time DATETIME);
CREATE TABLE rsa_tracking (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    service_record_id INTEGER,
    customer_location TEXT,
    dispatch_time TEXT,
    arrival_time TEXT,
    completion_time TEXT,
    serviceman_name TEXT,
    status TEXT
  , showroom TEXT DEFAULT 'Main Showroom');
CREATE TABLE accounts (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    email TEXT UNIQUE,
    password TEXT,
    name TEXT,
    role TEXT,
    status TEXT DEFAULT 'pending', -- pending, approved, rejected
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP
  , manager_email TEXT);
CREATE TABLE audit_logs (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    action TEXT,
    target_id INTEGER,
    performed_by TEXT, -- Admin name
    timestamp DATETIME DEFAULT CURRENT_TIMESTAMP
  );
CREATE TABLE showrooms (id INTEGER PRIMARY KEY AUTOINCREMENT, name TEXT UNIQUE);
CREATE TABLE lead_notes (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    lead_id INTEGER,
    note TEXT,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP
  );
CREATE TABLE raw_leads (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT,
    phone TEXT,
    source TEXT,
    showroom TEXT DEFAULT 'Main Showroom',
    timestamp DATETIME DEFAULT CURRENT_TIMESTAMP
  , lead_filled_by TEXT, assigned_to TEXT, referral_code TEXT);
CREATE TABLE referrals (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT,
    phone TEXT,
    address TEXT,
    pan_no TEXT,
    aadhar_no TEXT,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP
  , referral_code TEXT, referral_amount REAL DEFAULT 500);
CREATE TABLE payments (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    sale_no TEXT,
    amount REAL,
    payment_mode TEXT,
    collected_by TEXT,
    payment_date DATETIME DEFAULT CURRENT_TIMESTAMP
  , cash_by_whom TEXT, upi_account TEXT);
CREATE TABLE expenses (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    voucher_no TEXT,
    associated_no TEXT,
    expense_type TEXT,
    expense_date TEXT,
    given_to TEXT,
    amount REAL,
    paid_by TEXT,
    paid_via TEXT,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP
  , cash_by_whom TEXT, upi_account TEXT);
CREATE TABLE employees (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    employee_id TEXT UNIQUE,
    name TEXT,
    mobile TEXT,
    email TEXT,
    dob TEXT,
    aadhar_no TEXT,
    department TEXT,
    designation TEXT,
    manager_name TEXT,
    date_of_joining TEXT,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP
  , status TEXT DEFAULT "active", inactive_date TEXT, availability_status TEXT DEFAULT 'offline');
CREATE TABLE roles (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    role_name TEXT UNIQUE NOT NULL,
    description TEXT,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP
  );
CREATE TABLE permission_matrix (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    role_id INTEGER,
    module TEXT NOT NULL,
    can_view INTEGER DEFAULT 0,
    can_edit INTEGER DEFAULT 0,
    can_delete INTEGER DEFAULT 0,
    FOREIGN KEY (role_id) REFERENCES roles(id),
    UNIQUE(role_id, module)
  );
CREATE TABLE user_roles (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_email TEXT NOT NULL,
    role_id INTEGER NOT NULL,
    assigned_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (role_id) REFERENCES roles(id),
    UNIQUE(user_email, role_id)
  );
CREATE TABLE attendance (id INTEGER PRIMARY KEY AUTOINCREMENT, employee_id INTEGER, date DATE, clock_in DATETIME, clock_out DATETIME, status TEXT, total_hours REAL, created_at DATETIME DEFAULT CURRENT_TIMESTAMP, clock_in_photo TEXT, clock_out_photo TEXT, clock_in_location TEXT, clock_out_location TEXT);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX idx_sales_sale_no ON sales(sale_no);
COMMIT;
